import React from 'react';
import { Card } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

export const HomePage = () => {
  const navigate = useNavigate();

  const navigateToDetailPage = () => {
    navigate('/map');
  };

  return (
    <div style={{ paddingTop: '100px', display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
        <Card style={{ width: '18rem', cursor: 'pointer' }} onClick={navigateToDetailPage}>
        <Card.Img variant="top" src="image-url.jpg" />
        <Card.Body>
            <Card.Title>Card Title</Card.Title>
            <Card.Text>
            Some quick example text to build on the card title and make up the bulk of
            the card's content.
            </Card.Text>
        </Card.Body>
        </Card>
    </div>
  );
};
